          <FollowedClub name="Scope"/>
          <FollowedClub name="Scope"/>
          <FollowedClub name="Scope"/>
          <FollowedClub name="Scope"/>
        </ResultContainer>
      </div>
    </ContainerView>
  );
};

export default UserPage;
